--DROP TABLE alunos;
CREATE TABLE alunos (
	id INTEGER PRIMARY KEY IDENTITY(1,1),
	nome VARCHAR(100),
	cpf CHAR(14),
	nick VARCHAR(100),
	signo VARCHAR(100),
	numero_favorito VARCHAR(100),
	cor_preferida VARCHAR(100),
	nota_1 FLOAT,
	nota_2 FLOAT,
	nota_3 FLOAT,
	nota_4 FLOAT,
	data_nascimento DATETIME2
);

SELECT nome, cpf, nick, signo, numero_favorito, nota_1, nota_2, nota_3, nota_4, cor_preferida, data_nascimento
	FROM alunos;


--EXERCICIO 01 TABELA ALUNOS------------------------------------------------------------
--Selecione todas as colunas da tabela.

SELECT id, nome, cpf, nick, signo, numero_favorito, nota_1, nota_2, nota_3, nota_4, cor_preferida, data_nascimento
	FROM alunos;

--EXERCICIO 02 TABELA ALUNOS------------------------------------------------------------
--Selecione o nome dos alunos que a nota 1 é maior que 9.0.

SELECT nome, nota_1
	FROM alunos
	WHERE  nota_1 > 9.0;

--EXERCICIO 03 TABELA ALUNOS------------------------------------------------------------
--Selecione o nome do aluno, nota 1, nota 2, nota 3, nota 4, e a média.
ALTER TABLE alunos ADD media FLOAT;

SELECT nome, nota_1, nota_2, nota_3, nota_4, media = (nota_1 + nota_2 + nota_3 + nota_4)/4
	FROM alunos;

--EXERCICIO 04 TABELA ALUNOS------------------------------------------------------------
--Contabilize a quantidade de alunos com o signo de Peixes

ALTER TABLE alunos ADD qtd_sig_peixes INT;
SELECT qtd_sig_peixes = COUNT (nome)
FROM alunos
WHERE signo = 'peixes';

--EXERCICIO 05 TABELA ALUNOS------------------------------------------------------------
--Selecione a soma da nota 1

ALTER TABLE alunos ADD soma_nota_1 FLOAT;

SELECT soma_nota_1 = SUM (nota_1)
	FROM alunos;

--EXERCICIO 06 TABELA ALUNOS------------------------------------------------------------
--Selecione a média da nota 2

ALTER TABLE alunos ADD media_nota_2 FLOAT;

SELECT media_nota_2 = AVG (nota_2)
	FROM alunos;

--EXERCICIO 07 TABELA ALUNOS------------------------------------------------------------
-- Selecione o nome, menor nota 1.

SELECT nome, nota_1 
	FROM alunos
	WHERE nota_1 = (SELECT MIN(a.nota_1)
	FROM alunos a);

--EXERCICIO 08 TABELA ALUNOS------------------------------------------------------------
--Selecione o nome, nota 1, nota 2, nota 3, nota 4 com o maior nome.

SELECT nome, nota_1, nota_2, nota_3, nota_4
	FROM alunos
	WHERE nome = (SELECT MAX(a.nome)
	FROM alunos a);

--EXERCICIO 09 TABELA ALUNOS------------------------------------------------------------
--Selecione a cor e quantidade com a cor Gelo.
ALTER TABLE alunos ADD qtd_cor_gelo INT;

SELECT qtd_cor_gelo = COUNT (cor_preferida)
FROM alunos
WHERE cor_preferida = 'gelo';

--EXERCICIO 10 TABELA ALUNOS------------------------------------------------------------
--Selecione a quantidade de alunos que o nome contém Francisco no começo.

ALTER TABLE alunos ADD qtd_francisco_nome_começo INT;

SELECT qtd_francisco_nome_começo = COUNT(nome)
	FROM alunos
	WHERE nome LIKE 'Francisco%';

--EXERCICIO 11 TABELA ALUNOS------------------------------------------------------------
--Selecione a quantidade de alunos que o nome contém Luc
ALTER TABLE alunos ADD qtd_nomes_contem_luc INT;

SELECT qtd_nomes_contem_luc = COUNT(nome)
	FROM alunos
	WHERE nome LIKE '%luc%';

--EXERCICIO 12 TABELA ALUNOS------------------------------------------------------------
--Selecione o nome, signo e data de nascimento quando o signo Áries

SELECT nome, signo, data_nascimento
	FROM alunos
	WHERE signo = 'Áries';

--EXERCICIO 13 TABELA ALUNOS------------------------------------------------------------
--Selecione o nome, nota 1, nota 2, nota 3, nota 4 com o maior média.
UPDATE alunos SET media = (nota_1+nota_2+nota_3+nota_4)/4;

SELECT nome, nota_1, nota_2, nota_3, nota_4, media
	FROM alunos
	WHERE media = (SELECT MAX(a.media)
	FROM alunos a);

